package week1.day2;

public class LearnLooping {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 5; i<=10; i++) {	
			System.out.println(i);
			
		}
		for (int i = 6; i>=0; i--) {	
			System.out.println(i);
			
		}
		for (int i = 0;i<5; i++) {	
			System.out.println("TesLeaf");
			
		}
		
		

	}

}
